    <section id="info">
      <div class="info-wrapper">
        <div class="leftinfo">
  	<h2 class="verybritish">Ein englischer Doppeldecker für Kreuzwertheim<span> ... very british</span></h2>	  
  	<p>
  Unser historischer englischer Doppeldeckerbus aus den 60er Jahren feiert sein Comeback. Gemütlich, einzigartig und mit viel Charme wollen wir unseren Gästen etwas ganz besonderes im gastronomischen Bereich bei einem ausgewählten Sortiment mit deutschen und englischen Einflüssen bieten.<br>
  <br>
  Mit festem Standort an einem der schönsten Plätze in Kreuzwertheim direkt am Main begrüßen wir November bis April alle die, die eine etwas andere Atmosphäre mit herrlichem Blick auf die Wertheimer Altstadt und Burg genießen wollen.
  	</p>
